import React from "react";
import {Link} from "react-router-dom";
import "./Navigation.css";
import logoIMG from "./Logo.gif";

function Navigation(){
    return (
        <nav className = "header">
            <div className = "corp_name">
                <img 
                src = { logoIMG } 
                alt = "HWASEON"
                width = "300px"/>
            </div>
        </nav>
    )
}

export default Navigation;
